import { Frame, FramerAnimation } from "framer";
import { getWindowWidth, getWindowHeight } from '../window/window_dimensions.js';
import Link from 'next/link';

export default function Contact() {
    const widthLayer = Math.min( getWindowWidth(), 1920 )
    const heightLayer = getWindowHeight()
    const social =  
    [
        {
            link: '',
            src: '/sw_icons_svg/BE.svg',
            alt: 'logo behanse'
        },
        {
            link: '',
            src: '/sw_icons_svg/Insta.svg',
            alt: 'logo behanse'
        },
        {
            link: '',
            src: '/sw_icons_svg/Linked inn.svg',
            alt: 'logo behanse'
        },
        {
            link: '',
            src: '/sw_icons_svg/Tw.svg',
            alt: 'logo behanse'
        }
    ]

    return (
        <Frame
            width={widthLayer} 
            height={heightLayer}
            center 
            background="200a48"
        >
            <div>
                <h4>Contact me</h4>
                <h4>hello@frangon.com.ar</h4>
                <h4>Social</h4>
                <div>
                    {
                        social.map(
                            (x) => (
                                <Link href={ x.link } >
                                    <img src={ x.src } alt={ x.alt } />
                                </Link>
                            )
                        )
                    }
                </div>
            </div>
        </Frame>
    )

}

